package com.github.tool.io;

import cn.hutool.core.date.SystemClock;
import cn.hutool.core.io.FileUtil;
import cn.hutool.core.lang.Validator;
import com.github.tool.io.enums.LabelTypeEnum;
import com.google.common.collect.Lists;
import com.itextpdf.text.*;
import com.itextpdf.text.pdf.*;
import lombok.*;
import org.apache.commons.lang3.StringUtils;

import java.io.*;
import java.util.ArrayList;
import java.util.Base64;
import java.util.List;
import java.util.Optional;

/**
 * PdfUtil
 */
public class PdfUtil {

    /**
     * test
     */
    public static void main(String[] args) throws DocumentException, IOException {
        List<SkuPrintLabel> skuPrintLabels = new ArrayList<>();
        SkuPrintLabel skuPrintLabel1 = new SkuPrintLabel();
        skuPrintLabel1.setSkuName("手机1");
        skuPrintLabel1.setContent("SKU-001");
        skuPrintLabel1.setBarcodeFilePath("C:\\Users\\admin\\AppData\\Local\\Temp\\SKU-001.png");
        skuPrintLabels.add(skuPrintLabel1);

        SkuPrintLabel skuPrintLabel2 = new SkuPrintLabel();
        skuPrintLabel2.setSkuName("手机2");
        skuPrintLabel2.setContent("SKU-001");
        skuPrintLabel2.setBarcodeFilePath("C:\\Users\\admin\\AppData\\Local\\Temp\\SKU-001.png");
        skuPrintLabels.add(skuPrintLabel2);

        // 生成pdf
        Document document = null;
        try {
            LabelTypeEnum label74 = LabelTypeEnum.LABEL_7_4;
            RectangleReadOnly pageSize = new RectangleReadOnly(label74.getWidth(), label74.getHeight());
            document = new Document(pageSize, 0, 0, 0, 0);
            String pathname = FileUtil.getTmpDirPath() + File.separator + "label_" + SystemClock.now() + ".pdf";
            PdfUtil.createPrintLabelPdf(document, skuPrintLabels, pathname);
        } finally {
            Optional.ofNullable(document).ifPresent(Document::close);
        }

        List<String> data = Lists.newArrayList(
                "",
                ""
        );
        // base64转pdf
        for (int i = 0; i < data.size(); i++) {
            String pathname = FileUtil.getTmpDirPath() + File.separator + i + ".pdf";
            File file = new File(pathname);
            createPdfFromBase64(data.get(i), file);
        }

        // 多个base64转pdf
        String pathname = FileUtil.getTmpDirPath() + File.separator + "mergeMulBase64.pdf";
        File file = new File(pathname);
        createPdfFromBase64(data, file);

        // 合并文件
        List<File> files = new ArrayList<>();
        for (int i = 0; i < data.size(); i++) {
            files.add(new File(FileUtil.getTmpDirPath() + File.separator + i + ".pdf"));
        }
        pathname = FileUtil.getTmpDirPath() + File.separator + "mergeMulFile.pdf";
        file = new File(pathname);
        mergeMulFile(files, file);

    }

    @Setter
    @Getter
    @NoArgsConstructor
    static class SkuPrintLabel {

        /**
         * 条码路径
         */
        private String barcodeFilePath;

        /**
         * 内容
         */
        private String content;

        /**
         * sku名称
         */
        private String skuName;
    }

    /**
     * 生成打印标签pdf
     *
     * @param document       文档
     * @param skuPrintLabels 标签对象
     * @param pathname       文件路径名
     */
    @SneakyThrows
    public static void createPrintLabelPdf(Document document, List<SkuPrintLabel> skuPrintLabels, String pathname) {
        FileOutputStream outputStream = new FileOutputStream(pathname);
        PdfWriter.getInstance(document, outputStream);
        // 打开文档
        document.open();

        BaseFont bfChinese = BaseFont.createFont("pdf/fonts/SimHei.ttf", BaseFont.IDENTITY_H, BaseFont.NOT_EMBEDDED);
        Font f0 = new Font(bfChinese, 1, Font.BOLD);
        Font f1 = new Font(bfChinese, 3, Font.BOLD);
        Font f2 = new Font(bfChinese, 4, Font.BOLD);

        for (SkuPrintLabel skuPrintLabel : skuPrintLabels) {
            // 在文档中增加图片和文字
            // 新增一页
            document.newPage();
            // 图片上面空白
            document.add(new Paragraph(" ", f0));

            // 添加条码图片
            Image img = Image.getInstance(skuPrintLabel.getBarcodeFilePath());
            img.setAlignment(Image.MIDDLE | Image.TEXTWRAP);
            // 设置图片的显示大小
            img.scaleAbsolute(58, 17);
            document.add(img);

            // 添加条码文本
            Paragraph p = new Paragraph(skuPrintLabel.getContent(), f2);
            p.setAlignment(Element.ALIGN_CENTER);
            document.add(p);

            // skuName
            String skuName = subStr(skuPrintLabel.getSkuName(), Validator.hasChinese(skuPrintLabel.getSkuName()) ? 16 : 22);
            p = new Paragraph("Name: " + skuName, f1);
            p.setIndentationLeft(6);
            p.setAlignment(Element.ALIGN_LEFT);
            document.add(p);
        }
    }

    private static String subStr(String str, int i) {
        if (StringUtils.isEmpty(str)) {
            return "";
        }
        return str.length() > i ? str.substring(i) : str;
    }

    /**
     * base64转pdf
     */
    public static void createPdfFromBase64(String base64, File file) throws IOException, DocumentException {
        createPdfFromBase64(Lists.newArrayList(base64), file);
    }

    /**
     * 多个base64转pdf
     */
    public static void createPdfFromBase64(List<String> base64List, File file) throws IOException, DocumentException {
        @Cleanup FileOutputStream outputStream = new FileOutputStream(file);
        Document document = null;
        try {
            byte[] bytes = Base64.getDecoder().decode(base64List.get(0));
            PdfReader pdfReader = new PdfReader(bytes);
            document = new Document(pdfReader.getPageSize(1));
            PdfCopy copy = new PdfCopy(document, outputStream);
            document.open();
            for (String base64 : base64List) {
                bytes = Base64.getDecoder().decode(base64);
                pdfReader = new PdfReader(bytes);
                int pages = pdfReader.getNumberOfPages();
                // 遍历pdf文档
                for (int i = 1; i <= pages; i++) {
                    document.newPage();
                    PdfImportedPage page = copy.getImportedPage(pdfReader, i);
                    copy.addPage(page);
                }
            }
        } finally {
            Optional.ofNullable(document).ifPresent(Document::close);
        }
    }

    /**
     * 合并多个pdf文件
     *
     * @param files  文件列表
     * @param target 保存文件
     */
    public static void mergeMulFile(List<File> files, File target) throws IOException, DocumentException {
        @Cleanup FileOutputStream outputStream = new FileOutputStream(target);
        Document document = null;
        try {
            @Cleanup FileInputStream inputStream = new FileInputStream(files.get(0));
            PdfReader pdfReader = new PdfReader(inputStream);
            document = new Document(pdfReader.getPageSize(1));
            PdfCopy copy = new PdfCopy(document, outputStream);
            document.open();
            for (File file : files) {
                inputStream = new FileInputStream(file);
                pdfReader = new PdfReader(inputStream);
                int pages = pdfReader.getNumberOfPages();
                // 遍历pdf文档
                for (int i = 1; i <= pages; i++) {
                    document.newPage();
                    PdfImportedPage page = copy.getImportedPage(pdfReader, i);
                    copy.addPage(page);
                }
            }
        } finally {
            Optional.ofNullable(document).ifPresent(Document::close);
        }
    }
}
